import React from 'react';
import logo from './logo.svg';
//import './css/App.css';
import './css/alt.css';

class Square extends React.Component {
  render() {
    return <button type="button" className="blck border">
      {this.props.value}
    </button>
  }
}

class App extends React.Component {
  renderSquare(i){
    return <Square/>
  }
  render() {
    const status = 'Next Player: ';
    return(
      <div>
        <p>{status}</p>
        <div>
          {this.renderSquare(0)}
          {this.renderSquare(1)}
          {this.renderSquare(2)}
        </div>
        <div>
          {this.renderSquare(3)}
          {this.renderSquare(4)}
          {this.renderSquare(5)}
        </div>
        <div>
          {this.renderSquare(6)}
          {this.renderSquare(7)}
          {this.renderSquare(8)}
        </div>
      </div>
    );
  }
}

export default App;
